	function lzw_decode(array){
		var count=array.shift();
		// console.log(count)
		var table=[];
		for(var i=0;i<count;i++){
			table.push([i])
		}
		table.push(["clear code"])
		table.push(["end of information code"])
		var result=[];
		// console.log(table,array)
		var k;
		for(var i in array){
			if(array[i]==count+1){
				break;
			}
			if(i==0){
				k=table[array[i]][0];
				result.push(k);
				continue;
			}
			
			var color=table[array[i]];
			if(color){
				result=result.concat(color);
				k=color[0];
				// console.log(table,array[i-1],k)
				table.push(table[array[i-1]].concat(k));
				// console.log("yes")
			}else{
				k=table[array[i-1]][0];
				var tmp=table[array[i-1]].concat(k)
				result=result.concat(tmp);
				table.push(tmp);
				// console.log("no")
			}
			// console.log(JSON.stringify(color),table[table.length-1],k)
		}
		// console.log(table)
		return result;
	}
